const SPTableBody = (props) => {
  const data = props.body;
  console.log(data);
  return (
    <>
      {props.body.map((row, i) => {
        return (
          <tr key={i}>
            <td>{row.id}</td>
            <td>
              <img src={row.image_url} style={{ width: "10%" }} />
            </td>
            <td>
                {row.name}
            </td>
            <td>
                {row.price}
            </td>
          </tr>
        );
      })}
    </>
  );
};
export default SPTableBody;
